import React from "react";
// import activity from "../images/icons/activity_200.gif";
import activity from "../images/icons/activity.svg";
import sprite from "../images/sprite_60fps.svg";

function IconGrid() {
  return (
    <>
      <div>
        <img src={activity} alt="" style={{ width: "10%" }} />
      </div>
      <div
        class="shapeshifter play"
        // style="background-image: url(sprite_60fps.svg)"
        style={{ backgroundImage: `url(${sprite})` }}
      ></div>

      <style jsx>{`
        @keyframes play48 {
          0% {
            background-position: 0px 0px;
          }
          100% {
            background-position: -16320px 0px;
          }
        }
        .shapeshifter {
          animation-duration: 800ms;
          animation-timing-function: steps(48);
          width: 340px;
          height: 340px;
          background-repeat: no-repeat;
        }
        .shapeshifter.play {
          animation-name: play48;
        }
      `}</style>
    </>
  );
}

export default IconGrid;
